const token = "3px6cypvje3xsjmc";
const instance = "7827";
/**
 * get emails from your whatsapp
 */
const getmeInstanceurl = "https://api.chat-api.com/instance7827/me?token=3px6cypvje3xsjmc";
const getmeInstance = () => {
    fetch(fetchInstanceurl)
    .then((res)=> res.json())
    .then((json)=>{
        let meInstance = json;
        console.log(meInstance);
        return meInstance;
    })
}

export default getmeInstance;
